130.source:
function reset() {
    this.connections = {
        url: {},
        contentType: {},
        requestContent: {},
        requestContentParsed: {}
    }
    connect(this, 'url', this, 'doRequest');
    connect(this, 'requestContent', this.get('contentText'), 'textString');
    connect(this.get('url'), 'savedTextString', this, 'doRequest');
    connect(this, 'contentType', this.get('contentType'), 'textString');
    this.get('url').textString = 'http://lively-kernel.org';
    this.get('contentType').textString = 'content type';
    this.get('contentText').textString = 'content';
}

133.source:
function doRequest(url) {
    // url = "http://lively-kernel.org"
    url = url || this.get('url').textString
    this.get('url').textString = url;
    var request = URL.create(url).asWebResource().beAsync().get();
    this.get('contentText').textString = 'loading...';
    this.get('contentType').textString = '';
    connect(request, 'content', this, 'processRequestContent', {
        converter: function(content) { return this.sourceObj; },
    });
}

136.source:
function processRequestContent(req) {
    var typeHeader = req.status.getResponseHeader('content-type') || 'text/plain',
        requestContent, requestContentParsed;
    this.contentType = typeHeader;
    if (typeHeader.match(/\/json/)) {
        try {
            var requestContentParsed = JSON.parse(req.content),
                requestContent = JSON.prettyPrint(req.content);
            this.get('contentText').setTextMode('json');

        } catch (e) {}
    } else if (typeHeader.match(/\/html/)) {
        this.get('contentText').setTextMode('html');
    } else {
        this.get('contentText').setTextMode('text');
    }
    requestContentParsed = requestContentParsed || req.content;
    requestContent = requestContent || req.content;
    this.requestContent = requestContent;
    this.requestContentParsed = requestContentParsed;
}
